import React from 'react';
import Navbar from './Navbar.js';
import './App.css';
import Product from './ProductCard.js';

export default class Menu extends React.Component{
    render(){
        return(
            <div>
                <Navbar/>
                <div class="container">
                <div class="row">
                    <div class="col-12 col-md-4">
                        <Product/>
                    </div>
                </div>
                <div class="row">
                    <div class="col-12 col-md-4">
                        <Product/>
                    </div>
                </div>
                <div class="row">
                    <div class="col-12 col-md-4">
                        <Product/>
                    </div>
                </div>
                </div>
            </div>
        )
    }   
}
